import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const ChangeSectionClass = () => {
  return (
    <View>
      <Text>ChangeSectionClass</Text>
    </View>
  )
}

export default ChangeSectionClass

const styles = StyleSheet.create({})
